import React, { useState } from "react";
import Board from "./Board";
import "./Container.css";


function Container() {


    return (
        <div className="container">
            <div className="color-picker">
                <input type="color"/>
            </div>
            <div className="board-container">
                <Board></Board>
            </div>
        </div>
    );
};


export default Container;
